import React, {useState} from "react"
import {Box, Button, Flex} from "rebass"
import {
  Label,
  Input
} from '@rebass/forms'
export default () => {
const [ID,setID] = useState('')

let handleChange = (e) =>{
 setID(e.target.value)
}

  return (<Box>
 <Box width={1/3} px={2}>
 <Flex>
 <Box>
      <Label htmlFor='IMDB ID'>IMDB ID</Label>
      <Input
      value={ID}
      onChange={(e)=>handleChange(e)}
        id='IMDB ID'
        name='IMDB ID'
        defaultValue=''
      /></Box><Button co>Fetch Movie</Button></Flex></Box>
  </Box>)
}
